Defines whether to use one or two antennas for downlink transmission and in which mode.
0: Single stream SISO/SIMO, single TX antenna;
1: Single stream TX diversity (Alamouti);      
2: Double Stream 2x2 MIMO Spatial Multiplexing (open loop);
3: Dynamic MIMO Switch Control Algorithm for open loop MIMO;
4: Dynamic MIMO Switch Control Algorithm for closed loop MIMO;
5: Single stream Beamforming;
6: Dual Layer Beamforming;
7: Closed loop MIMO4x2;
8: 4-way transmit diversity;
9: Closed Loop MIMO 8x2 with TM9
For DCM following applies. Value 0 shall be used when there is 1 TX antenna. Value 3 shall be used when there are 2 TX antennas. Value 2 can be used when static 2 CW tranmission without considering Rank Indications from UE is required, i.e. only for testing purposes.

Configures the short DRX cycle. It is recommended to set this parameter to smaller value than drxLongCycle.
Values: {10, 20, 40, 80, 160, 320, 640}
WMP only.
